import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Header from "./components/Header/Header";
import Navbar from "./components/Navbar/Nav";
import Profile from "./components/Profile/Profile";
import Messages from "./components/Messages/Messages";
import Setting from "./components/Setting/Setting";
import News from "./components/News/News";
import Music from "./components/Music/Music";


const App = (props) => {

    let dialogs = [ {id: 'david', name: 'David Bowie'},
                    {id: 'queen', name: 'Group Queen'},
                    {id: 'kenye', name: 'Kanye West'}];

    let messages = [{id: 1, text: 'Pressure pushing down on me'},
                    {id: 2, text:'Pressing down on you, no man ask for'},
                    {id: 3, text:'Um ba ba be'}];


    return (
        <BrowserRouter>
            <div className='app-wrapper'>
                <Header/>
                <Navbar/>
                <div className='app-wrapper-content'>
                    <Routes>
                        <Route path='/profile' element={<Profile posts={props.posts}/>}/>
                        <Route path='/messages' element={<Messages dialogs={dialogs} messages={messages}/>}/>
                        <Route path='/news' element={<News/>}/>
                        <Route path='/music' element={<Music/>}/>
                        <Route path='/setting' element={<Setting/>}/>
                    </Routes>
                </div>
            </div>
        </BrowserRouter>
    );
}

export default App;
